import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

function Card(){
  return(
<div className="cards col-12 ">
   <div className = " d-flex ">
   <div className="card cards col-4 m-5 ">
     <img src="https://i.ytimg.com/vi/uNppTCoYdWI/maxresdefault.jpg" alt="" />
     <div className="card_info">
       <span className="car_category">A Original Netflix Movies</span>
       <h3 className="card_tile">Fast & Furious Presents</h3>
       <a href="https://www.netflix.com/pk/title/81073022">
         <button>Click Now</button>
       </a>
     </div>
     </div>
   </div>

 </div>
  )
};

ReactDOM.render(
 <>
 <Card/>
 <Card/>
 <Card/>

 </>,

  document.getElementById("root")
)
